import React from "react";

function Experience() {
  return (
    <div>
      <div
        className="center flex"
        style={{ height: "1000px", textAlign: "center" }}
      >
        <h1>Experience</h1>
        <div className="d-flex flex-row h-">
          <h2>Software Developer</h2>
          <h3>Freelance</h3>
          <h4>2021 - Present</h4>
          <p>
            I am a freelance software developer. I have worked on various
            projects including web development, mobile development, and desktop
            development. I have experience with technologies such as HTML, CSS,
            JavaScript, React, Node.js, Python, Java, and C#.
          </p>
        </div>
      </div>
    </div>
  );
}

export default Experience;
